import React from "react";
import "./GroupsListPage.css";

interface Group {
  id: string;
  name: string;
  description: string;
  members: number;
  maxMembers: number;
  entryFee: number;
  isPrivate: boolean;
  owner: string;
}

const GroupsListPage: React.FC = () => {
  // Mock data
  const myGroups: Group[] = [
    {
      id: "1",
      name: "Weekend Warriors",
      description: "Casual golf betting group for weekend tournaments",
      members: 8,
      maxMembers: 12,
      entryFee: 25,
      isPrivate: false,
      owner: "golfpro123",
    },
    {
      id: "2",
      name: "Masters Pool 2025",
      description: "Annual Masters tournament pool",
      members: 15,
      maxMembers: 20,
      entryFee: 50,
      isPrivate: true,
      owner: "augusta_fan",
    },
  ];

  const allGroups: Group[] = [
    ...myGroups,
    {
      id: "3",
      name: "Pro Golfers Club",
      description: "Elite group for professional golfers",
      members: 5,
      maxMembers: 10,
      entryFee: 100,
      isPrivate: true,
      owner: "pro_golfer",
    },
    {
      id: "4",
      name: "Open Golf League",
      description: "Public league for all golf enthusiasts",
      members: 20,
      maxMembers: 30,
      entryFee: 10,
      isPrivate: false,
      owner: "open_league_admin",
    },
  ];

  const handleGroupClick = (groupId: string) => {
    alert(`Navigating to group with ID: ${groupId}`);
    // Navigate to group details page (e.g., using React Router)
    // navigate(`/groups/${groupId}`);
  };

  return (
    <div className="groups-list-container">
      <h1 className="groups-list-title">Groups List</h1>
      <div className="groups-grid">
        {allGroups.map((group) => (
          <div
            key={group.id}
            className="group-card"
            onClick={() => handleGroupClick(group.id)}
          >
            <div className="group-card-header">
              <h3 className="group-name">{group.name}</h3>
              <span
                className={`group-privacy ${
                  group.isPrivate ? "private" : "public"
                }`}
              >
                {group.isPrivate ? "Private" : "Public"}
              </span>
            </div>
            <p className="group-description">{group.description}</p>
            <div className="group-stats">
              <div className="group-stat">
                <span className="stat-value">{group.members}</span>
                <span className="stat-label">Members</span>
              </div>
              <div className="group-stat">
                <span className="stat-value">${group.entryFee}</span>
                <span className="stat-label">Entry Fee</span>
              </div>
            </div>
            <p className="group-owner">Owner: {group.owner}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default GroupsListPage;
